import React from "react";
import "./ExpenseItem.css";

const ExpenseItem = (props) => {


  const deleteHandler = () => {
    props.onDelete(props.id);
  }

  return (
    <div>
      <div onClick={deleteHandler} className="goal-item">{props.text}</div>
    </div>
  );
};

export default ExpenseItem;
